import React from "react";
import "../css_styles/cards.css";
const CelebCart = ({ celeb }) => {
  return (
    <div className="cards">
      <img src={celeb.urlToImage} alt="" />

      <div className="cards_text">
        <h2 className="cards__title">{celeb.title}</h2>
      </div>
    </div>
  );
};

export default CelebCart;
